import React from 'react';
import ReactDOM from 'react-dom';
import { App } from "./App";
import {Route, Router} from "react-router";

ReactDOM.render(
    <React.StrictMode>
        <Router>
            <Route path={"/"} component={App}/>
        </Router>
        {/*<App />*/}
    </React.StrictMode>,
    document.getElementById('root')
);
